type Props = {
  gap?: number;     
  count?: number;   
  fill?: string;
  opacity?: number;
};

export default function StripesBackground({
  gap = 60,         
  count = 1,        
  fill = "#3A308C",
  opacity = 1,
}: Props) {
   const svgRef = useRef<SVGSVGElement>(null);
  const [center, setCenter] = useState({ x: 0, y: 0 });

  useEffect(() => {
    if (!svgRef.current) return;
    const rect = svgRef.current.getBoundingClientRect();
    setCenter({ x: rect.width / 2, y: rect.height / 2 });

    const handleResize = () => {
      if (!svgRef.current) return;
      const rect = svgRef.current.getBoundingClientRect();
      setCenter({ x: rect.width / 2, y: rect.height / 2 });
    };

    window.addEventListener("resize", handleResize);
    return () => window.removeEventListener("resize", handleResize);
  }, []);

  const indices = Array.from({ length: count * 2 + 1 }, (_, i) => i - count);

  return (
    <svg
      ref={svgRef}
      aria-hidden="true"
      className="pointer-events-none absolute inset-0 w-full h-full -z-10"
      xmlns="http://www.w3.org/2000/svg"
    >

      <g transform={`translate(${center.x} ${center.y})`} shapeRendering="geometricPrecision">
        {indices.map((k) => (
          <path
            key={k}
            d={STRIP_PATH}
            fill={fill}
            opacity={opacity}
            transform={`translate(${k * gap})`}
          />
        ))}
      </g>
    </svg>
  );
}
